@GregorySuvalian he cannot exec into a running container because his container would be exiting immediately with the error.

@Makla run your container by overriding the default entrypoint.
`docker run -it <imagename> powershell`. Then you can check from the resulting command line if your files are present.

Also check if the Web.dll is in fact in the `/app` folder. Is it possible it is in a subfolder? In that case you may need to give the correct path relative to your WORKDIR

